import React, { useState } from "react";
import styles from './QrButton.module.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { Popup } from "../Popup/Popup";
import clsx from "clsx";

function QrPopUp(props) {
    return (
        <div>

        </div>
    );
}

export function QrButton(props) {
    const [click, setClick] = useState(false);

    const style = clsx(styles.qr_button, {
        [styles.qr_position_true]: click,
        [styles.qr_position_false]: click
    })

    return (
        <div className={style}>
            <div onClick={() => setClick(true)} className="btn btn-outline-primary rounded-5">
                <FontAwesomeIcon icon="fa-solid fa-qrcode" />
            </div>
            {click ?
                <Popup close={() => setClick(false)} top={false}>
                    <QrButton />
                </Popup> :
                null}

        </div>
    );
}
